import React from 'react';
import {BrowserRouter, Routes, Route} from "react-router-dom";

function Router() {
    return (
        <BrowserRouter>

                <Routes>
                    <Route path="/">
                        <div>Home</div>
                    </Route>
                    <Route path="/">
                        <div>Register</div>
                    </Route>
                    <Route path="/">
                        <div>Login</div>
                    </Route>
                </Routes>

        </BrowserRouter>
    )
}

export default Router
